import React from "react";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";

//importing react components
import Dashboard from "./components/Dashboard";
import AccommodationHome from "./components/Accommodation/AccommodationHome";
import DisplayAccommodation from "./components/Accommodation/Accommodations";
import AddAccommodation from "./components/Accommodation/AddAccommodation";
import EditAccommodation from "./components/Accommodation/EditAccommodation";

export default function App() {
  return (
    <Router>
      <div className="container-fluid">
        
        {/* Accommodation management start */}

        <Route path="/" exact component={Dashboard}/>
        <Route path="/Accommodation-Home/" exact component={AccommodationHome} />
        <Route path="/Accommodation/" exact component={DisplayAccommodation} />
        <Route path="/Accommodation/add" exact component={AddAccommodation} />
        <Route path="/Accommodation/edit/:id" exact component={EditAccommodation} /> 
         

        {/* End */}
      </div>
    </Router>
  );
}
